def unpack_packed(data_bytes: bytes) -> bytes:
    import gzip

    if len(data_bytes) < 3:
        raise ValueError("payload too short")

    xor_offset = data_bytes[1]
    comp = bytearray(len(data_bytes) - 2)
    for i in range(len(comp)):
        comp[i] = data_bytes[2 + i] ^ ((i + xor_offset) & 0xFF)
    return gzip.decompress(bytes(comp))


def decrypt_data() -> dict:
    import json
    if isinstance(data, bytes):
        text = data.decode("utf-8")
    else:
        text = str(data)
    packed = text.encode("latin1")

    raw_json = unpack_packed(packed)
    return json.loads(raw_json.decode("utf-8"))


